import React, { useEffect, useState } from "react";
import axios from "axios";
const Test = () => {
  const [user, setUser] = useState([]);
  useEffect(() => {
    axios
      .get(`https://jsonplaceholder.typicode.com/users`)
      .then((data) => {
        console.log(data.data);
        setUser(data.data)
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return <div>
    {user.map}
  </div>;
};

export default Test;
